	position: relative;
	z-index: 1;
	padding: 0px;
	margin: 0px;
	font-size: 1px;
	overflow: hidden;
	border: none;
	height: 100%;
	width: 6px;
	top: 0;
	cursor: col-resize;

	background: #e0e0e0 url('@assets/ui/erp/sidebar.png');
	&.left {
		right: 0;
		&.close {
			left: 1px !important;
			& > div {
				&::after {
					transform: rotate(180deg);
					-webkit-transform: rotate(180deg);
					-moz-transform: rotate(180deg);
					-ms-transform: rotate(180deg);
					-o-transform: rotate(180deg);
				}
			}
		}
	}
	&.right {
		// right: 400px;
		&.close {
			right: 0 !important;
		}
	}
	&.bottom {
		height: 6px;
		width: 100%;
		cursor: row-resize !important;
		& > div {
			transform: translate(-50%, 0) rotate(90deg);
			left: 50%;
		}
		&.close {
			bottom: 3px !important;
		}
	}
	&.top {
		display: none;
		background: none;
		background: #d1d1d1 url('@assets/ui/erp/sidebar.png');
		height: 11px;
		width: 100%;
		cursor: row-resize !important;
		& > div {
			transform: translate(-50%, 0) rotate(90deg);
			left: 50%;
		}
		&.close {
			bottom: 3px !important;
		}
	}
	@media screen and(max-width:1050px) {
		&.top {
			display: block;
		}
		
	}
	& > div {
		position: absolute;
		padding: 0px;
		margin-top: -25px;
		overflow: hidden;
		cursor: pointer;
		z-index: 1;
		height: 50px;
		width: 6px;
		top: 50%;
		background: #eee;
		border: 1px solid #796c6c;
		box-sizing: border-box;
		&:after {
			position: absolute;
			border-right: 4px solid #796c6c;
			border-top: 4px solid transparent;
			border-bottom: 4px solid transparent;
			top: 20px;
			left: 0;
			content: '';
		}
		&.toggle-close-icon:after {
			position: absolute;
			border-right: none;
			border-left: 4px solid #796c6c;
			border-top: 4px solid transparent;
			border-bottom: 4px solid transparent;
			top: 20px;
			left: 0;
			content: '';
		}
	}
	&.dragging,
	&.close,
	&:hover {
		visibility: visible;
		background: #d1d1d1 url('@assets/ui/erp/sidebar.png');
	}

	&.right > div::after,
	&.bottom > div::after,
	&.bottom-right > div::after {
		transform: rotate(180deg);
		-webkit-transform: rotate(180deg);
		-moz-transform: rotate(180deg);
		-ms-transform: rotate(180deg);
		-o-transform: rotate(180deg);
	}
	&.right.close > div::after,
	&.bottom.close > div::after,
	&.bottom-right.close > div::after {
		transform: rotate(360deg);
		-webkit-transform: rotate(360deg);
		-moz-transform: rotate(360deg);
		-ms-transform: rotate(360deg);
		-o-transform: rotate(360deg);
	}
	&:hover > div,
	&.close > div {
		display: block;
	}
}

	flex-direction: column-reverse;
	height: 100% !important;
}

	display: none !important;

	min-width: 354px;
	background-color: #fff;
	height: 26px;
	padding: 5px 10px 0 10px;
	border-bottom: 1px solid #e0e0e0;
}
.router-switch-button {
	display: flex;
	background-color: #fff;
}
.router-switch-button {
	height: 26px;
	button {
		flex: 1;
		min-width: 96px;
		width: 25%;
		height: 26px;
		border: 1px solid #e0e0e0;
		border-bottom: none;
		outline-style: none;
		background-color: #f1f1f1;

		&:hover {
			cursor: pointer;
		}
		&:first-of-type {
			border-right: none;
		}
	}
	.active {
		background-color: #fff;
		color: #3c9bff;
		font-weight: bold;
		height: 27px;
	}
}
.left-SMT-Bom-top {
	min-width: 534px;
}

// BOM & DFM & gerber
.left-Bom-top {
	display: flex;
	// margin-top: 5px;
	margin: 5px 0;
	> button {
		min-width: 45px;
		color: #3097fc;
		background-color: #fff;
		margin-left: 10px;
		width: 100px;
		outline-style: none;
		border: 1px solid #cecece;
		border-radius: 2px;
		&:hover {
			border: 1px solid #3097fc;
		}
	}
}

.left-search-button {
	display: flex;
	button {
		height: 30px;
		width: 30px;
		outline-style: none;
		border: 1px solid #3399ff;
		border-left: none;
		background-color: #ffffff;
		line-height: 40px;
		&:first-child {
			border-left: 1px solid #3399ff;
		}
		&:hover {
			background-color: #e6f7ff;
		}
		&.select-btn {
			background-color: #e6f7ff;
		}
		img {
			width: 66%;
		}
	}
}
.left-search-text {
	background-image: url('@assets/ui/erp/icon_svg/eda-zoom.svg');
	background-repeat: no-repeat;
	background-position: 135px;
	margin: 0 10px;
	padding-right: 30px;
	padding-left: 5px;
	width: 120px;
	outline-style: none;
	border: 1px solid #cecece;
}
.left-search-text.iptWidth {
	height: 28px;
	width: 150px;
	margin-left: 30px;
	background-position: 160px;
}
.left-Bom-middle {
	display: flex;
	margin: 10px 0;
	font-size: 14px;
	:global(#lab_0) {
		padding-right: 20px;
		border-right: 1px solid #e1e1e1;
		color: #ff3224;
		cursor: pointer;
		overflow: hidden;
		text-overflow: ellipsis;
		white-space: nowrap;
	}
	:global(#lab_1) {
		font-family: Arial, 'Microsoft YaHei';
		overflow: hidden;
		text-overflow: ellipsis;
		white-space: nowrap;
		padding-right: 20px;
		// margin-left: 20px;
		border-right: 1px solid #e1e1e1;
		// color: #2e90e7;
		color: #333;
		cursor: pointer;
	}
	:global(#lab_2) {
		font-family: Arial, 'Microsoft YaHei';
		padding-right: 20px;
		margin-left: 20px;
		// color: #949494;
		color: #333;
		cursor: pointer;
		overflow: hidden;
		text-overflow: ellipsis;
		white-space: nowrap;
	}
}

.table-head {
	position: sticky;
	top: 0;
	z-index: 9;
}
.table-head-MatchingTools {
	min-width: 100px;
	width: 100%;
}

.table-body-bom {
	height: calc(100vh - 182px) !important;
	scroll-behavior: smooth;
	table {
		border-top: none;
		td {
			border-top: none;
		}
	}
}

.table-body {
	width: 100%;
	td {
		height: 60px;
		text-align: left;
		border: 1px solid #cbcbcb;
		// border-top: none; // \u53BB\u9664\u4E0A\u8FB9\u6846\uFF0C\u770B\u8D77\u6765\u50CF\u5355\u8FB9\u6846
		padding-left: 10px;
		padding-right: 10px;
		p {
			overflow: hidden;
			text-overflow: ellipsis;
			white-space: nowrap;
			.detail-span {
				font-size: 12px;
				color: #3399ff;
				text-decoration: underline;
				margin-right: 5px;
				cursor: pointer;
			}
		}
	}
	tr:hover {
		background-color: #e6f7ff;
	}
	.table-body-color {
		.len {
			text-decoration: underline;
			cursor: pointer;
		}
	}
	.table-body-red {
		color: #f6211d;
		position: relative;
	}
	.table-body-blue {
		position: relative;
	}
	.table-body-gary {
		color: #c5c5c5;
	}
	.table-body-orange {
		position: relative;
		p {
			color: #fe7419;
			margin-right: 10px;
		}
		
	}
	.table-body-search {
		height: 100%;
		width: 100%;
		border: none;
		outline-style: none;
	}
}

.bom-table {
	min-width: 945px;
	scroll-behavior: smooth;
	:global(#jlc) td td {
		padding-top: 5px;
		padding-bottom: 5px;
	}
	p {
		margin: 5px 0px;
		word-wrap: break-word;
	}
	td {
		border-top: 1px solid #cbcbcb; // \u663E\u793A\u4E0A\u8FB9\u6846
	}
}

.bom-table-MatchingTools {
	min-width: 100px;
	// overflow-x: overlay;
	overflow-x: auto;
}
.table-private-component {
	height: 30px;
	line-height: 30px;
	font-size: 14px;
	font-weight: bold;
	color: #f6211d;
}

.table-founded-component {
	display: none;
	height: 30px;
	line-height: 30px;
	font-size: 14px;
	font-weight: bold;
	color: #3399ff;
	display: inline-block;
	margin-right: 10px;
}

.table-notfound-component {
	display: inline-block;
	height: 30px;
	line-height: 30px;
	font-size: 14px;
	font-weight: bold;
	color: #999999;
	margin-left: 10px;
	span {
		font-size: 12px;
		font-weight: normal;
		color: black;
	}
}
.table-eda-delete {
	visibility: hidden;
}

.bomFile,
.bomButton,
.bomButton:hover {
	border: 1px solid #3097fc;
}
// \u6EDA\u52A8\u6761\u6837\u5F0F
::-webkit-scrollbar {
	width: 8px !important;    
	height: 8px !important;
}
::-webkit-scrollbar-thumb {
	border-radius: 8px !important;
	background-color: #999 !important;
}
::-webkit-scrollbar-track {
	border-radius: 8px !important;
	background-color: #d9d9d9 !important;
}

.tab {
	width: 100%;
	height: 100%;
	border-left: 1px solid #dcdcdc;
	border-bottom: none;
	padding-top: 2 * @setRemPx;

	font-size: 10px;

	.tab_button_normal {
	}
	.tab_button_selected {
		width: 80%;

		background-color: #fff;
		display: flex;
		justify-content: center;
		align-items: center;

			height: 100%;

			justify-content: center;

			line-height: 1.2 * @setRemPx;

			font-weight: bold;

			text-align: center;
		}
	}
}
.comboBox_panel {
	width: 100%;
	height: 100%;

	.comboBox_container {
		display: flex;
		flex-direction: column;
		justify-content: flex-start;
		align-items: center;
		padding-right: 2.4 * @setRemPx;

		.comboBox_list {
			display: flex;
			flex-direction: column;
			justify-content: flex-start;
			align-items: center;
			width: 100%;

			&:first-child {
				margin-top: 0.6 * @setRemPx;
			}
		}
	}
}

	display: flex;
	flex-direction: column;
}
.smt-preview-header {
	height: 32px;
	display: flex;
	justify-content: space-between;
	.smt-preview-header-left {
		position: relative;
		z-index: 3;
		margin-left: 6px;
		background-color: white;
		display: flex;
		align-items: center;
		.open-editor {
			width: 130px;
			height: 24px;
			line-height: 24px;
			padding: 0 5px;
			margin-right: 6px;
			color: #3399ff;
			font-size: 12px;
			white-space: nowrap;
			border: 1px solid #3399ff;
			border-radius: 3px;
			box-sizing: border-box;
			cursor: pointer;
			display: flex;
			align-items: center;
			img {
				margin-right: 5px;
			}
			&:hover {
				background-color: #e6f7ff;
			}
		}
	}
	.smt-preview-header-center {
		.device-visible-switch {
			line-height: 32px;
			margin-left: 12px;
		}
	}
	.smt-preview-header-right {
		display: flex;
		flex-direction: row;
		text-align: center;
		align-items: center;
		margin-right: 6px;
		.layer-switch {
			margin-left: 30px;
		}
	}
}

.order-title-wrap {
	position: absolute;
	z-index: 2;
	width: 100%;
	height: 32px;
	display: flex;
	justify-content: center;
	.order-title {
		font-size: 16px;
		font-weight: 600;
		// \u8BBE\u7F6E\u6587\u672C\u80FD\u591F\u88AB\u9009\u4E2D\uFF0C\u4EE5\u4FBF\u901A\u8FC7 execCommand('copy') \u590D\u5236\u6587\u672C
		user-select: text;
		cursor: pointer;
		line-height: 32px;
		max-width: calc(100% - 950px);
		white-space: nowrap;
		overflow: hidden;
		text-overflow: ellipsis;
		// #order-id {
		// 	cursor: pointer;
		// }
	}
}

@media screen and (max-width: 1350px) {
	.order-title-wrap {
		width: calc(100% - 475px);
		right: 0;
		.order-title {
			max-width: 95%;
		}
	}
}

		}

			text-align: center;

}

	position: fixed !important;
	top: 50%;
	left: 50%;
	min-width: 300px;
	z-index: 2000;
	background-color: #fff;
	border-radius: 2px;
	border: 1px solid #d1d1d1;
	box-shadow: 0px 0px 12px 2px rgba(0, 0, 0, 0.4);
	transform: translate(-50%, calc(-50% - 30px));
	opacity: 1;
	visibility: hidden;
	// transition: 0.24s;

	// animation: eda-modal-hidden .2s forwards;
	.eda-modal-container {
		display: flex;
		border-radius: 2px;
		flex-direction: column;
		height: 100%;
		width: 100%;
		.eda-modal-header {
			position: relative;
			color: rgba(0, 0, 0, 0.85);
			background: #fff;

			height: 28px;
			line-height: 28px;

			display: flex;

				font-size: 12px;
				color: #303133;
				flex: 1;
			}

				background-image: url('@assets/ui/erp/icon_svg/eda-x.svg');

				height: 24px;
				cursor: pointer;
				position: relative;
				text-align: center;
				left: 6px;
				background-size: 24px 24px;
				cursor: pointer;
				text-align: center;
				line-height: 28px;

				&:hover {
					filter: invert(52%) sepia(11%) saturate(2798%) hue-rotate(171deg) brightness(113%) contrast(107%);
				}
			}
		}

				display: flex;
			}
			.icon {
				padding-right: 4px;
				transform: translateY(-1px);
				img {
					width: 20px;
					height: 20px;
				}
			}
		}

		.eda-message-box__btns {
			display: flex;
			flex-direction: row-reverse;
			padding: 0px 16px 16px;
			text-align: right;
		}
		.modal-btn {
			height: 28px;
			width: fit-content;
			margin-left: 8px;
			padding: 0 16px;
			font-size: 12px;
			box-sizing: border-box;
		}
	}
}

.eda-modal-top {
	top: 20%;
	width: 400px;
}

	visibility: visible;

	transform: translate(-50%, -50%);

}

	border: 1px solid #d9d9d9;
